Male genitalia:
Pygofer moderately projected posteriorly, apex widey rounded; macrosetae very long, distributed along apical third of pygofer (
Fig.54a
). Valve ovate, with margins rounded, slightly curved. Plates long, apex pointed and setae plumose (
Fig. 54b
). Style with apophysis short, with striae, apex truncate, lobulate (
Fig. 54c
). In ventral view aedeagus with base narrow, straight, lateral margin rounded; shaft straight, narrow, apex rounded and wider toward apex, shaft shorter than ventral process (
Fig. 54d
). Ventral processes arising a little beyond mid point of aedeagal length, divergent, narrow, with apices pointed; ventral processes with sclerotized spirals. In lateral view shaft with base narrow then widening toward apex, curved slightly caudad, apex truncate, shorter than ventral processes; dorsal projection tapered, curved caudad. Gonopore apical. Ventral process arising close to base of shaft, curved dorsad, apices pointed, with sclerotized spirals (
Fig. 54e
).
